import './ascent.css';
import React from 'react';

import apis from '../../api';

class Ascent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {teams: []};
    }

    componentDidMount = async () => {
        await apis.getTeamsByMap('Ascent').then(res => {
            this.setState({
                teams: res.data.data,
            })
        })
    }

    displayTeam = () => {
        return (
            <div>
                Ascent
            </div>
        )
    }
    
    render() {
        return (
            <div>
                {this.displayTeam}
            </div>
        )
    }
};

export default Ascent;
